(106, 'https', 'localhost:7153', '/api/Film/add', '', 'Accept: application/json, text/plain, */*\nHost: localhost:7153\nUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/134.0.0.0 Safari/537.36\nAccept-Encoding: gzip, deflate, br, zstd\nAccept-Language: en-GB,en-US;q=0.9,en;q=0.8\nContent-Type: multipart/form-data; boundary=----WebKitFormBoundaryeE0zV18xTOOMIp5n\nCookie: accessToken=eyJhbGciOiJIUzUxMiIsInR5cCI6IkpXVCJ9..CR9WILhTZJbgTFS9abCti1Q_MpGgOM30U-0ALIA3tuowgdkzdRIvH2tYLELTaPFLtPsOrGhACnCBvZN2ydXoFw; refreshToken=FF2ADF2C216ACC6E02A56AD8547A2DEADD39D24FB0C89F6328720936FAF61CFC\nOrigin: https://localhost:60769\nReferer: https://localhost:60769/\nContent-Length: 2911\nsec-ch-ua-platform: \"Windows\"\nsec-ch-ua: \"Chromium\";v=\"134\", \"Not:A-Brand\";v=\"24\", \"Google Chrome\";v=\"134\"\nDNT: 1\nsec-ch-ua-mobile: ?0\nsec-fetch-site: same-site\nsec-fetch-mode: cors\nsec-fetch-dest: empty\npriority: u=1, i\n', 'Content-Disposition: form-data; name=\"Cim\"\r\nValue: Egy Minecraft film\r\nContent-Disposition: form-data; name=\"Kategoria\"\r\nValue: 2D\r\nContent-Disposition: form-data; name=\"Mufaj\"\r\nValue:  Vígjáték, Családi\r\nContent-Disposition: form-data; name=\"Korhatar\"\r\nValue: 12\r\nContent-Disposition: form-data; name=\"Jatekido\"\r\nValue: 101\r\nContent-Disposition: form-data; name=\"Gyarto\"\r\nValue: USA 2025\r\nContent-Disposition: form-data; name=\"Rendezo\"\r\nValue: Jared Hess\r\nContent-Disposition: form-data; name=\"Szereplok\"\r\nValue: Jason Momoa, Jack Black, Emma Myers, Danielle Brooks, Jennifer Coolidge\r\nContent-Disposition: form-data; name=\"Leiras\"\r\nValue: Lépj be a Minecraft világába, ahol a kreativitás a minimum – annak, aki életben akar maradni. Négyen vannak: az egyikük a 80-as években volt nagy videójátékos (Jason Momoa), a másik mobilállatkertet üzemeltet (vagyis egy lámát fuvaroz ide-oda az autóján), egy testvérpár (egy fiatal nő és iskolás kisöccse) meg most költözött a városba, és még nem tudja, merre mennyi. Aztán úgy alakul, hogy egy titokzatos átjárón keresztül mindannyian átzuhannak egy izgalmas, kiismerhetetlen és nagyon furcsa másik világba, ahol minden kockákból épül, és csak a képzelet szab neki határt. Ha haza akarnak jutni, akkor rá kell jönniük, mi hogy működik ezen a helyen (és meg kell menekülniük a malac és zombi formájában érkező gonosz lényektől) – ennek érdekében pedig hosszú vándorútra kell indulniuk Steve, a régóta a kockavilágban élő, tapasztalt építőmester (Jack Black) vezetésével. Még szerencse, hogy út közben valamennyien felismernek magukban egy-két addig lappangó képességet, és rájönnek, hogy bennük is pezseg a fantázia: csak hagyni kell szárnyalni.\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: A Minecraft Movie\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=ZUqHtdB27uo\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.1\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 27\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 38\n', '{\"errorMessage\":\"Sikeres hozzáadás\"}', 200, '2025-04-07 20:21:07.001278'),
