(208, 'https', 'localhost:7153', '/api/Film/add', '', 'Accept: application/json, text/plain, */*\nHost: localhost:7153\nUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/135.0.0.0 Safari/537.36\nAccept-Encoding: gzip, deflate, br, zstd\nAccept-Language: en-GB,en-US;q=0.9,en;q=0.8\nContent-Type: multipart/form-data; boundary=----WebKitFormBoundaryKF53LFHrPaH9pva9\nCookie: accessToken=eyJhbGciOiJIUzUxMiIsInR5cCI6IkpXVCJ9..qjyYZBEAv3NfWvAOWd0eSiZaDCf3fnRUq4-AaEKPBb7uu45dUFpzXni6hKxwlCebyIYuu_y1a9SI7Y51qzbFvA; refreshToken=7CC254C61CC47D95F42E85B92EF14756DF2301521DFD6E2A9B1A3C324F21F603\nOrigin: https://localhost:60769\nReferer: https://localhost:60769/\nContent-Length: 2588\nsec-ch-ua-platform: \"Windows\"\nsec-ch-ua: \"Google Chrome\";v=\"135\", \"Not-A.Brand\";v=\"8\", \"Chromium\";v=\"135\"\nDNT: 1\nsec-ch-ua-mobile: ?0\nsec-fetch-site: same-site\nsec-fetch-mode: cors\nsec-fetch-dest: empty\npriority: u=1, i\n', 'Content-Disposition: form-data; name=\"Cim\"\r\nValue: Barbie\r\nContent-Disposition: form-data; name=\"Kategoria\"\r\nValue: 2D\r\nContent-Disposition: form-data; name=\"Mufaj\"\r\nValue:  Vígjáték, Fantasy\r\nContent-Disposition: form-data; name=\"Korhatar\"\r\nValue: 12\r\nContent-Disposition: form-data; name=\"Jatekido\"\r\nValue: 115\r\nContent-Disposition: form-data; name=\"Gyarto\"\r\nValue: Heyday Films, LuckyChap Entertainment, NB/GG Pictures, Mattel Films\r\nContent-Disposition: form-data; name=\"Rendezo\"\r\nValue: Greta Gerwig\r\nContent-Disposition: form-data; name=\"Szereplok\"\r\nValue: Margot Robbie, Ryan Gosling, America Ferrara, Kate McKinnon, Michael Cera, Will Ferrell\r\nContent-Disposition: form-data; name=\"Leiras\"\r\nValue: Van ám olyan világ, ahol minden csodálatos! Mindig süt a nap, lenn a parton mindig lágyan hullámzik a tenger, és szörfdeszkákon, a nyugágyakban meg a bulizósabb helyeken sokféle, de mindig gyönyörű strandoló gyűlik össze: Barbie (Margot Robbie) és Ken (Ryan Gosling) meg a többi Barbie és Ken. De még legtökéletesebb, legrózsaszínebb, legszerelmesebb helyen is történhetnek bajok. Szerencsére Barbie nemcsak szép, hanem talpraesett is. Ha kell, még a valóságos világba is elmegy, hogy megvédje a maga különleges országát. És persze sosincs egyedül. Lehet, hogy Ken nem olyan éles eszű, vagy nem akkora vagány, mint ő, de van egy nagyon fontos tulajdonsága: mindig kiáll az ő Barbie-jáért, és sosem hagyja cserben.\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: Barbie\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=S7qsTilxELA\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.8\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 36\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 38\n', '{\"errorMessage\":\"Sikeres hozzáadás\"}', 200, '2025-04-08 19:49:47.094151'),
