on Momoa), a másik mobilállatkertet üzemeltet (vagyis egy lámát fuvaroz ide-oda az autóján), egy testvérpár (egy fiatal nő és iskolás kisöccse) meg most költözött a városba, és még nem tudja, merre mennyi. Aztán úgy alakul, hogy egy titokzatos átjárón keresztül mindannyian átzuhannak egy izgalmas, kiismerhetetlen és nagyon furcsa másik világba, ahol minden kockákból épül, és csak a képzelet szab neki határt. Ha haza akarnak jutni, akkor rá kell jönniük, mi hogy működik ezen a helyen (és meg kell menekülniük a malac és zombi formájában érkező gonosz lényektől) – ennek érdekében pedig hosszú vándorútra kell indulniuk Steve, a régóta a kockavilágban élő, tapasztalt építőmester (Jack Black) vezetésével. Még szerencse, hogy út közben valamennyien felismernek magukban egy-két addig lappangó képességet, és rájönnek, hogy bennük is pezseg a fantázia: csak hagyni kell szárnyalni.\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: A Minecraft Movie\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=ZUqHtdB27uo\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.1\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 27\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 39\n', '{\"errorMessage\":\"Sikeres módosítás\"}', 200, '2025-04-08 20:22:49.410903'),
