tő törvényét, s szóba áll egy emberrel, Vanessával, a New York-i virágárussal. Megdöbbenéssel tölti el a felfedezés, hogy az emberek évszázadok óta lopják és eszik a méhek mézét, s világossá válik előtte, hogy mire hivatott valójában az életben: a világot rendbe kell tennie, az emberiséget be kell perelnie a drága méz eltulajdonításáért.\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: Bee Movie\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=Erhp69qof0Y\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.1\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 38\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 38\n', '{\"errorMessage\":\"Sikeres hozzáadás\"}', 200, '2025-04-09 17:35:10.010693'),
