evő, és olyan ereje van, amilyennel még egyiküknek sem volt dolga. És mivel a Sonic csapat képességeit ez a kihívás minden szempontból meghaladja, keresniük kell egy váratlan szövetségest, hogy megállítsák Shadow-t, és megvédjék a bolygót…\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: Sonic the Hedgehog 3\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=glg2dVvjnMI\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.9\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 54\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 38\n', '{\"errorMessage\":\"Sikeres hozzáadás\"}', 200, '2025-04-10 20:18:11.269511'),
